package pattren_Programs;

public class Inverted_L_Type_Pattern {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i = 0; i < 5; i++) {
			
			System.out.print("* ");
			
		}
		System.out.println();
		for (int i = 0; i < 4; i++) {
			System.out.println("*");
			
		}

	}

}
